sources.freestyle.css:
.fe-NumberedList li {
  line-height: 1.35;
  list-style: decimal;
  margin-bottom: 0.25rem;
  margin-left: 1rem;
  margin-right: 0;
  margin-top: 0;
}
.fe-AppLayout {
  display: flex;
  flex-direction: column;
  flex-wrap: nowrap;
  height: 100%;
  justify-content: flex-start;
  min-height: 100%;
  min-width: 960px;
}
.fe-AppLayout--responsive {
  min-width: auto;
  width: 100%;
}
.fe-AppLayout-header {
  flex-shrink: 0;
  position: relative;
}
.fe-AppLayout-main {
  background-color: #fff;
  display: flex;
  flex-basis: auto;
  flex-direction: column;
  flex-grow: 1;
  flex-shrink: 0;
}
.fe-AppLayout-main--centered {
  justify-content: center;
}
.fe-AppLayout-footer {
  flex-basis: auto;
  flex-grow: 0;
  flex-shrink: 0;
  margin-top: auto;
}
@media print {
  .fe-AppLayout {
    display: block;
  }
}
.fe-Page {
  box-sizing: border-box;
  display: flex;
  flex-direction: column;
  flex-wrap: nowrap;
  justify-content: flex-start;
  width: 100%;
}
.fe-Page--centred {
  justify-content: center;
  margin: auto;
  min-width: auto;
}
@media print {
  .fe-Page {
    display: block;
  }
}
.fe-ActionGroup {
  display: flex;
  flex-wrap: wrap;
  margin-left: -0.5rem;
  margin-top: 1rem;
}
.fe-ActionGroup--flush {
  margin-top: -0.5rem;
}
.fe-ActionGroup-action {
  margin-left: 0.5rem;
  margin-top: 0.5rem;
}
.fe-ActionList {
  background-color: #fff;
  display: block;
  margin: 0;
  min-width: 200px;
}
.fe-ActionList--scrolls {
  box-shadow: inset 0 -6px 12px -6px rgba(0, 0, 0, 0.1);
  max-height: 400px;
  overflow: auto;
}
.fe-ActionList-header {
  font-size: 0.8125rem;
  font-family: "Helvetica Neue", Arial, Helvetica, sans-serif;
  font-weight: 700;
  line-height: 24px;
  padding-left: 0.5rem;
  padding-right: 0.5rem;
  padding-top: 0.5rem;
}
.fe-ActionList-sectionHeader {
  font-size: 0.6875rem;
  color: #7b8a93;
  font-family: "Helvetica Neue", Arial, Helvetica, sans-serif;
  font-weight: 500;
  line-height: 24px;
  padding-left: 0.5rem;
  padding-right: 0.5rem;
  padding-top: 0.5rem;
  text-transform: uppercase;
}
.fe-ActionList-item {
  font-size: 0.875rem;
  align-items: center;
  background-color: transparent;
  border: none;
  box-sizing: border-box;
  color: #181a1b;
  cursor: pointer;
  display: flex;
  font-family: "Helvetica Neue", Arial, Helvetica, sans-serif;
  font-weight: normal;
  justify-content: space-between;
  line-height: 20px;
  min-height: 36px;
  overflow-wrap: break-word;
  padding: 0.5rem;
  text-align: left;
  text-decoration: none;
  transition: box-shadow 200ms;
  white-space: normal;
  width: 100%;
  word-break: break-word;
}
.fe-ActionList-item:hover {
  background-color: #f8f9fa;
  color: inherit;
  text-shadow: none;
}
.fe-ActionList-item:focus {
  box-shadow: inset 0 0 0 2px #007abf;
  color: inherit;
  outline: none;
}
.fe-ActionList-item:focus:hover {
  background-color: #f8f9fa;
}
.fe-ActionList-item--separator {
  border-top: 1px solid #d8dde0;
}
.fe-ActionList-item--bold {
  font-weight: 700;
}
.fe-ActionList-itemIcon {
  display: block;
  margin-bottom: -2px;
  margin-top: -2px;
}
.fe-ActionList-itemIcon:last-child {
  margin-right: -6px;
}
.fe-ActionList-nameplate {
  display: flex;
  flex-basis: 0%;
  flex-direction: column;
  flex-grow: 1;
  flex-shrink: 0;
  line-height: 20px;
  min-width: 0;
  padding: 0.5rem;
}
.fe-ActionList-userName {
  color: #181a1b;
  font-weight: bold;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
}
.fe-ActionList-companyName {
  color: #5e6e78;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
}
@media screen and (min-width: 68.75em) {
  .fe-ActionList-companyName {
    display: none;
  }
}
.fe-ActionList-timer {
  align-items: center;
  display: flex;
  justify-content: space-between;
  position: relative;
}
.fe-ActionList-timer:not(:first-child) {
  border-top: 1px solid #ebeeef;
}
.fe-ActionList-timerDetails {
  background-image: none;
  box-sizing: border-box;
  display: block;
  flex: 1 1 auto;
  max-width: 100%;
  padding-bottom: 0.5rem;
  padding-left: 0.5rem;
  padding-right: 64px;
  padding-top: 0.5rem;
  text-decoration: none;
  transition: box-shadow 200ms;
}
.fe-ActionList-timerDetails:hover {
  background-color: #f8f9fa;
}
.fe-ActionList-timerDetails:focus {
  box-shadow: inset 0 0 0 2px #007abf;
  outline: none;
}
.fe-ActionList-timerDetails:focus:hover {
  background-color: #f8f9fa;
}
.fe-ActionList-timerActions {
  align-items: center;
  box-sizing: border-box;
  display: flex;
  flex: 0 0 40px;
  height: 100%;
  position: absolute;
  right: 0.5rem;
  top: 0;
}
.fe-ActionList-loadingMessage {
  align-items: center;
  box-sizing: border-box;
  display: flex;
  height: 100%;
  justify-content: center;
  min-height: 32px;
  padding: 0.5rem;
}
.fe-ActionList-company--vertical {
  align-items: flex-start;
  flex-direction: column;
}
.fe-ActionList-segment {
  border-bottom: 1px solid #ebeeef;
  padding: 0.5rem;
}
.fe-AppFooter {
  background-color: #2b3840;
  color: rgba(255, 255, 255, 0.8);
  display: block;
  font-size: 13px;
  max-width: 100vw;
  min-height: 3rem;
  padding-bottom: 2.5rem;
  padding-top: 0.75rem;
}
@media screen and (min-width: 48em) {
  .fe-AppFooter {
    padding-bottom: 0.75rem;
  }
}
@media screen and (min-width: 60em) {
  .fe-AppFooter {
    height: 3rem;
    padding-bottom: 0;
    padding-top: 0;
  }
}
.fe-AppFooter--advantage {
  background-color: #003466;
}
.fe-AppFooter--rbsg {
  background-color: #0a2f64;
}
.natwest .fe-AppFooter--rbsg {
  background-color: #42145f;
}
.fe-AppFooter-content {
  align-items: center;
  display: flex;
  flex-direction: column;
}
@media screen and (min-width: 60em) {
  .fe-AppFooter-content {
    flex-direction: row-reverse;
    justify-content: space-between;
  }
}
@media screen and (min-width: 60em) {
  .fe-AppFooter-links,
  .fe-AppFooter-tagline {
    display: flex;
    flex: 1 0 auto;
  }
}
.fe-AppFooter-linkList,
.fe-AppFooter-tagline {
  display: flex;
  justify-content: center;
  margin-bottom: 0.75rem;
}
@media screen and (min-width: 60em) {
  .fe-AppFooter-linkList,
  .fe-AppFooter-tagline {
    justify-content: flex-start;
    margin: 0;
  }
}
.fe-AppFooter-linkListItem {
  list-style: none;
  margin: 0;
  padding: 0;
}
.fe-AppFooter-link {
  color: currentColor;
  letter-spacing: 0.25px;
  margin-left: 0.5rem;
  margin-right: 0.5rem;
  text-decoration: underline;
  white-space: nowrap;
}
.fe-AppFooter-link:focus,
.fe-AppFooter-link:hover {
  color: #fff;
}
.fe-AppFooter-logoWrapper {
  padding-left: 0.75rem;
  padding-right: 0.75rem;
}
@media screen and (min-width: 60em) {
  .fe-AppFooter-logoWrapper {
    align-items: center;
    display: flex;
    height: 3rem;
    max-width: 20rem;
    padding-right: 1.5rem;
  }
}
.fe-AppFooter-logo {
  display: block;
  max-height: 100%;
  max-width: 100%;
  position: relative;
  top: 1px;
}
.fe-AppFooter-madeWithLoveAndCoffeeAndBurritos {
  color: #fff;
  margin-left: auto;
  margin-right: auto;
  padding-top: 0.75rem;
  text-align: center;
}
.fe-AppNav {
  background-color: #007abf;
  background-image: linear-gradient(to top, #004a80 1px, transparent 1px);
  box-sizing: border-box;
  display: block;
  min-height: 48px;
  padding-bottom: 0;
  padding-top: 0;
}
.fe-AppNav::after {
  clear: both;
  content: "";
  display: table;
}
.fe-AppNav-title {
  font-size: 1rem;
  color: #fff;
  display: inline-block;
  line-height: 120%;
  margin-top: 0.75rem;
  padding-left: 15px;
}
.fe-AppNav-title:hover {
  color: #fff;
}
.fe-AppNav-navigationItems {
  box-sizing: border-box;
  display: flex;
  margin: 0 auto;
}
.fe-AppNav-item {
  align-items: center;
  background-color: transparent;
  background-image: linear-gradient(to top, #004a80 1px, transparent 1px);
  border: none;
  box-sizing: border-box;
  color: #fff;
  display: flex;
  flex-basis: auto;
  flex-grow: 0;
  flex-shrink: 0;
  height: 48px;
  letter-spacing: 0.25px;
  line-height: 48px;
  min-width: 48px;
  padding-bottom: 0;
  padding-left: 0.75rem;
  padding-right: 0.75rem;
  padding-top: 0;
  text-align: center;
  text-decoration: none;
}
.fe-AppNav-item.is-current {
  background-color: #0067af;
  background-image: linear-gradient(to top, #004a80 4px, transparent 3px);
}
.fe-AppNav-item:hover,
.fe-AppNav-item[aria-expanded="true"] {
  background-color: #0067af;
  color: #fff;
}
.fe-AppNav-item:focus {
  background-color: #005896;
  color: #fff;
  outline: none;
}
.fe-AppNav-item:active {
  background-color: #005896;
}
.fe-AppNav-spacer {
  flex: 0 0 32px;
  margin-right: auto;
}
.fe-AppNav-itemLabel {
  font-size: 0.875rem;
  align-items: center;
  box-sizing: border-box;
  display: flex;
  line-height: inherit;
  white-space: nowrap;
  width: 100%;
}
.fe-AppNav-accountMenu {
  min-width: 48px;
  overflow: hidden;
}
.fe-AppNav-item--businessName {
  flex-basis: auto;
  flex-grow: 0;
  flex-shrink: 1;
  width: 100%;
}
.fe-AppNav-item--businessName .fe-AppNav-itemLabel {
  align-items: center;
  overflow: hidden;
}
.fe-AppNav-labelText--constricted {
  overflow: hidden;
  text-overflow: ellipsis;
}
.fe-AppNav-icon {
  align-items: center;
  box-sizing: border-box;
  display: flex;
  flex-basis: auto;
  flex-grow: 0;
  flex-shrink: 0;
}
.fe-AppNav-icon:only-child {
  margin-left: -0.75rem;
  margin-right: -0.75rem;
}
.fe-AppNav-itemLabel + .fe-AppNav-icon,
.fe-AppNav-labelText--constricted + .fe-AppNav-icon {
  margin-left: 0.25rem;
  margin-right: -6px;
}
.fe-AppNav-itemLabel--desktop {
  display: none;
}
.fe-AppNav-itemLabel--mobile {
  display: flex;
}
@media screen and (min-width: 68.75em) {
  .fe-AppNav-itemLabel--desktop {
    display: flex;
  }
  .fe-AppNav-itemLabel--mobile {
    display: none;
  }
}
.fe-AppNav-colourScheme--admin {
  background-color: #7e328f;
